<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P34995

</mark>
 antagonist reduces blood-brain barrier leakage after cerebral ischemia . Disruption of the blood-brain barrier ( BBB ) after cerebral ischemia is considered to be the initial step in the development of brain injuries , and an increase in the tyrosine phosphorylation of the tight junctional protein occludin has been shown to cause an increase in BBB permeability . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00917
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00917
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) appears to be associated with both toxic and protective effects on neuronal survival in vitro . However , it remains to be determined whether the prostanoid EP1 receptor is involved in the disruption of the BBB after cerebral ischemia . So we examined the effect of a prostanoid EP1 receptor antagonist , SC51089 , on BBB leakage and tyrosine phosphorylation of occludin after cerebral ischemia . We demonstrated that SC51089 attenuated the increase in the tyrosine phosphorylation of occludin in isolated brain capillaries , which was coincident with a decrease in BBB leakage . These results suggest that the prostanoid EP1 receptor is involved in the tyrosine phosphorylation of occludin at tight junction , which may lead to disruption of the BBB and be linked to the development of cerebral infarctions .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effect of increased serotonin levels on [ 18F ] MPPF binding in rat brain : fenfluramine vs the combination of citalopram and ketanserin . [ 18F ] MPPF is a selective serotonin - 1A (

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) receptor antagonist and may be used to measure changes in the functional levels of serotonin ( 5 - HT ) . The technique is based on the assumption that the injected radiolabeled ligand competes for the same receptor as the endogenous transmitter . Results from studies using serotonergic ligands are not always consistent . The aim of the present study was to investigate if [ 18F ] MPPF binding is decreased after an increase in 5 - HT levels . [ 18F ] MPPF binding was assessed in conscious rats using ex vivo autoradiography . We studied the effect of the 5 - HT-releasing agent and reuptake inhibitor fenfluramine ( 10 mg / kg i . p . ) and of a combination of the selective serotonin reuptake inhibitor ( SSRI ) citalopram ( 10 micromol / kg , s . c . ) with the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28335
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist ketanserin ( 100 nmol / kg , s . c ) . The effect of both treatments on extracellular 5 - HT levels was determined using microdialysis . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00574
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 treatment resulted in a 30 - fold increase in extracellular 5 - HT levels in the ventral hippocampus and induced a significant reduction of [ 18F ] MPPF binding in the frontal cortex , hypothalamus , amygdala , and hippocampus . The microdialysis results showed a 10 - fold 5 - HT increase in the ventral hippocampus after combined administration of ketanserin and citalopram . The combination , however , did not affect [ 18F ] MPPF binding . Our data show that [ 18F ] MPPF binding in conscious rats is only reduced after substantial and therefore nonphysiological increases in 5 - HT levels . These results may imply that the majority of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 receptors is in the low-affinity state , in vivo .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Higher levels of activation markers and chemokine receptors on T lymphocytes in the cervix than peripheral blood of normal healthy women . Heterosexual transmission of human immunodeficiency virus ( HIV - 1 ) is the predominant mode of infection world-wide . To better understand sexual transmission of HIV - 1 in women we have analysed virus co-receptor and cellular activation marker expression on T lymphocyte subsets from the cervical epithelium and have made comparisons with peripheral blood T cells . Intraepithelial cervical T lymphocytes were obtained with a cytobrush , immunolabelled and analysed by flow cytometry . Activation markers ( Q07108 , CD25 and HLA-DR ) were found to be more highly expressed on cervical than on blood T lymphocytes . These higher levels of activation on cervical T lymphocyte subsets could facilitate HIV - 1 infection .
